  [],\n\t\"revision_timestamp\": \"2016-10-25T19:02:55.980022\",\n\t\"name\": \"midway-atoll-national-wildlife-refuge-narrative-report-1994-calendar-year\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Midway
  Atoll NWR outlines Refuge accomplishments during the 1994 calendar year. The report
  begins with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses the management
  plan, compliance with environmental and cultural resource mandates, and research
  and investigations. Refuge administration is outlined; information about personnel,
  volunteer programs, funding, safety, and technical assistance is given. Habitat
  management is also covered; subjects include forests, grasslands, pest control,
  contaminants, and wildlife hazards. The wildlife section of the report discusses
  wildlife diversity, endangered and threatened species, waterfowl, shorebirds, raptors,
  marine mammals, fisheries resources, scientific collections, animal control, and
  marking and banding. The public uses of the Refuge described in this report include
  interpretive programs, hunting, fishing, trapping, wildlife observation, outdoor
  recreation, and law enforcement. The equipment and facilities section of the report
  provides information about equipment replacement, communication systems, and computer
  systems. Cooperative programs and items of interest are provided at the end.\",\n\t\"license_title\":
